window.bookSummaryJSON = "<p><b>The Synth Crisis Collection: Books One to Three</b></p> <p>In a future where humans and synthetics coexist in an uneasy peace, a mysterious string of murders threatens to undermine this hard-fought balance. Now, it's up to detective Dhata Mays to find the killer before the case goes public. But can he be unbiased in a black and white world that forces him to take sides?<br> </p> <p>Collection includes:</p> <ul> <li><i>The Judas Cyper</i></li> <li><i>The Unsung Frame</i></li> <li><i>The Sigma Imperative</i></li> </ul> <p><i>Robust future worlds, action-packed cyberpunk, and mysteries that keep you guessing.</i></p>"; 
